import '../css/form.css';
import Login from "../hooks/Login";
import {useCookies} from "react-cookie";


function Authorization() {
    const [cookies, setCookie, useCookie] = useCookies(["user"]);

    async function Submit(data) {
        data.preventDefault();

        let toSave = await Login(data.target[0].value, data.target[1].value);
        console.log(toSave);
    }

    return (
        <form className='form-registration' onSubmit={Submit}>
            <h3>email</h3>
            <input type='email'/>
            <h3>password</h3>
            <input type='password'/>
            <button>Submit</button>
        </form>
    );
}

export default Authorization;
